import React, {useState} from "react";
import { TodoList } from "./components/TodoList.jsx";

export function App(){
    const [todos, setTodos] = useState([
        {id: 1, text: "Hacer la compra"},
    ]);

    return (
        <TodoList todos={todos}/>,
        <input type="text" placeholder="Nueva Tarea"/>
    );
}
